import React from "react";
import Anime from "../Components/Anime.jpg";


export const MainCTA = () => {
  return (
    <div className="position-relative overflow-hidden p-3 p-md-5 m-md-3 text-center bg-light">
      <div className="col-md-5 p-lg-5 mx-auto my-5">
        <h1 className="display-4 fw-normal">Happiness Is A Gift</h1>
        <p className="lead fw-normal">
          Show your thanks with one of our large or small gift collections,
          uniquely designed to bring happiness to someone you cares most.
        </p>
        <a className="btn btn-outline-secondary" href="#">
          Buy Now
        </a>
        <img src="Anime.jpg" class="img-fluid" alt="..."></img>
      </div>
      <div className="product-device shadow-sm d-none d-md-block" />
      <div className="product-device product-device-2 shadow-sm d-none d-md-block" />
    </div>
  );
};
